import { useEffect } from 'react';
import AuthUser from './AuthUser';

export default function Dashboard() {
  const { fetchUsers, users, fetchPosts, wpisy } = AuthUser();

  useEffect(() => {
    fetchUsers();
    fetchPosts();
  }, []);

  return (
    <table className="table">
      <thead>
        <tr>
          <th>Nazwa użytkownika</th>
          <th>Treść wpisu</th>
        </tr>
      </thead>
      <tbody>
        {users.map((user) => (
          <tr key={user.id}>
            <td>{user.name}</td>
            <td>
              {wpisy.map((wpis) => (
                <div key={wpis.id}>
                  {wpis.tresc}
                  <button className="btn btn-danger">
                    Usuń
                  </button>
                  <button className="btn btn-primary">
                    Edytuj
                  </button>
                </div>
              ))}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
